import React from 'react';
function Cards(props){
    return (
    <div className="card">
        <img src = {props.imgsrc}/>
        <div className="title">
        <h1>{props.title}</h1>
        </div>
        <div>
            <h2>{props.sname}</h2>
        </div>
        <div className = 'name'>
        <a href = {props.links}><button>Start Now</button></a>
        </div>
    </div>
    );
};
export default Cards;
